import React from "react";
import {
  ButtonContainer,
  CardContainer,
  Container,
  Form,
  Inner,
  InputContainer,
  UserImg,
  UserInfo,
  UserText,
  UserTextBox,
  Wrap,
} from "./styled";
import {
  Button,
  ContentContainer,
  ErrorMessage,
  Hr,
  Input,
  Label,
  Title,
} from "src/commonStyles";
import { SubmitHandler, useForm } from "react-hook-form";
import CompanyCard from "../Companies/CompanyCard/CompanyCard";

interface IFormInput {
  firstName: string;
  lastName: string;
  birthday: string;
  sex: string;
  country: string;
  city: string;
  login: string;
  email: string;
}

export default function PersonalCabinet() {
  const {
    register,
    handleSubmit,
    formState: { errors },
    reset,
  } = useForm<IFormInput>();

  const onSubmit: SubmitHandler<IFormInput> = (data) => {
    console.log(data);
    reset();
  };

  return (
    <Wrap>
      <ContentContainer>
        <Title>Личный кабинет</Title>
        <Hr />
        <Inner>
          <UserInfo>
            <UserImg $backgroundImg="https://images.unsplash.com/photo-1633332755192-727a05c4013d?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8dXNlcnxlbnwwfHwwfHx8MA%3D%3D&w=1000&q=80" />
            <UserTextBox>
              <UserText>Иванов Иван</UserText>
              <UserText>id:123</UserText>
            </UserTextBox>
          </UserInfo>
          <Form >
            <Container>
              <InputContainer>
                <Label htmlFor="firstName" $height="43px">
                  Имя
                </Label>
                <Input
                  {...register("firstName")}
                  id="firstName"
                  $width="349px"
                />
                <ErrorMessage>{errors.firstName?.message}</ErrorMessage>
              </InputContainer>
              <InputContainer>
                <Label htmlFor="lastName" $height="43px">
                  Фамилия
                </Label>
                <Input
                  {...register("lastName", {
                    required: { value: true, message: "Заполните поле" },
                  })}
                  id="lastName"
                  $width="349px"
                />
              </InputContainer>
            </Container>
            <Container>
              <InputContainer>
                <Label htmlFor="birthday" $height="43px">
                  Дата рождения
                </Label>
                <Input
                  {...register("birthday", {
                    required: { value: true, message: "Заполните поле" },
                  })}
                  id="birthday"
                  $width="349px"
                />
              </InputContainer>
              <InputContainer>
                <Label htmlFor="sex" $height="43px">
                  Пол
                </Label>
                <Input
                  {...register("sex", {
                    required: { value: true, message: "Заполните поле" },
                  })}
                  id="sex"
                  $width="349px"
                />
              </InputContainer>
            </Container>
            <Container>
              <InputContainer>
                <Label htmlFor="country" $height="43px">
                  Страна
                </Label>
                <Input
                  {...register("country", {
                    required: { value: true, message: "Заполните поле" },
                  })}
                  id="country"
                  $width="349px"
                />
              </InputContainer>
              <InputContainer>
                <Label htmlFor="city" $height="43px">
                  Город
                </Label>
                <Input
                  {...register("city", {
                    required: { value: true, message: "Заполните поле" },
                  })}
                  id="city"
                  $width="349px"
                />
              </InputContainer>
            </Container>
            <Container>
              <InputContainer>
                <Label htmlFor="login" $height="43px">
                  Логин
                </Label>
                <Input
                  {...register("login", {
                    required: { value: true, message: "Заполните поле" },
                  })}
                  id="login"
                  $width="753px"
                />
              </InputContainer>
            </Container>
            <Container>
              <InputContainer>
                <Label htmlFor="email" $height="43px">
                  E-mail
                </Label>
                <Input
                  {...register("email", {
                    required: { value: true, message: "Заполните поле" },
                  })}
                  id="email"
                  $width="753px"
                />
              </InputContainer>
            </Container>
            <ButtonContainer>
              <Button $gray>Сменить пароль</Button>
            </ButtonContainer>
            <ButtonContainer>
              <Button type="submit">Сохранить</Button>
            </ButtonContainer>
          </Form>
        </Inner>
        <Title>Ваши компании:</Title>
        <Wrap>
          <ContentContainer>
            <CardContainer>
              <CompanyCard
                key={1}
                imgUrl={"/static/media/company-img.3ee103e2549bf8865a2c.png"}
                name={"Медицинский центр"}
                reviewsScore={4}
              />
              <CompanyCard
                key={2}
                imgUrl={"/static/media/company-img.3ee103e2549bf8865a2c.png"}
                name={"Медицинский центр"}
                reviewsScore={3}
              />
              <CompanyCard
                key={3}
                imgUrl={"/static/media/company-img.3ee103e2549bf8865a2c.png"}
                name={"Медицинский центр"}
                reviewsScore={2}
              />
            </CardContainer>
            {/* {cards.length === 0 && <Container>Нет компаний</Container>} */}
          </ContentContainer>
        </Wrap>
      </ContentContainer>
    </Wrap>
  );
}
